import "./Header.css";
import MenuTap from './MenuTap';
function Header(){



    return (
        // make nav bar code here
        <div className="header">
            <div className="header__logo">
                <h1>로고</h1>
            </div>
            <div className="header__menu">
                <MenuTap/>
            </div>
        </div>
    );
    }

export default Header;
